var title_f26_17_26905="LLL atelectasis I";
var content_f26_17_26905=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F57305%7EPULM%2F69045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F57305%7EPULM%2F69045&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Left lower lobe atelectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 374px; height: 375px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Left lower lobe atelectasis due to an aspirated foreign body in a small child. A wedge- shaped opacity is seen in retrocardiac location (arrow). Its oblique lateral border is formed by the major fissure. The left hilum is obscured partially and displaced caudad. The residual left upper lobe is hyperexpanded, accounting for the increased lucency in the left hemithorax.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Chronic left lower lobe atelectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 370px; height: 377px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chronic atelectasis of the left lower lobe due to previous pneumonia. A triangular opacity is faintly visible in the retrocardiac region (black arrows. The left hilum is displaced caudad. The residual left lung is hyperlucent. A band of opacity, called the top of the knob sign, is present around the aortic arch (white arrow); this finding is due to mediastinal shift to the left.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
