var title_f26_17_26909="Quality measures scrn eval";
var content_f26_17_26909=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F59932&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F59932&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Quality measures for urinary incontinence screening and evaluation",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Target population",
"       </td>",
"       <td class=\"subtitle1\">",
"        Source",
"       </td>",
"       <td class=\"subtitle1\">",
"        Screening",
"       </td>",
"       <td class=\"subtitle1\">",
"        Evaluation and management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"6\">",
"        Persons aged 65 and above at high risk for functional decline (see below)",
"       </td>",
"       <td rowspan=\"6\">",
"        ACOVE",
"        <sup>",
"         [1]",
"        </sup>",
"       </td>",
"       <td>",
"        <strong>",
"         ALL",
"        </strong>",
"        vulnerable elders should annually have documentation of the presence or absence of UI.",
"       </td>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder has new UI or UI at the time of a new evaluation,",
"        <strong>",
"         THEN",
"        </strong>",
"        treatment options should be discussed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         ALL",
"        </strong>",
"        vulnerable elders should have documentation of the presence or absence of UI (UI) during the initial evaluation.",
"       </td>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder has new UI that persists for over 1 month or UI at the time of new evaluation,",
"        <strong>",
"         THEN",
"        </strong>",
"        a post-void residual should be obtained prior to initiating medication.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        &nbsp;",
"       </td>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder has new UI that persists for over 1 month or UI at the time of a new evaluation,",
"        <strong>",
"         THEN",
"        </strong>",
"        a targeted history should be obtained that documents each of the following: (1) characteristics of voiding, (2) ability to get to the toilet, (3) prior treatment for UI, (4) importance of the problem to the patient, and (5) mental status.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder has new UI that persists for over 1 month or UI at the time of a new evaluation,",
"        <strong>",
"         THEN",
"        </strong>",
"        a targeted physical exam should be performed that documents (1) a rectal exam (for men) and (2) a pelvic exam for women.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder has new UI that persists for over 1 month or UI at the time of new evaluation,",
"        <strong>",
"         THEN",
"        </strong>",
"        dipstick urinalysis should be obtained.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         IF",
"        </strong>",
"        a vulnerable elder undergoes surgery or periurethral injections for UI,",
"        <strong>",
"         THEN",
"        </strong>",
"        subtracted cystometry should be performed prior to the procedure.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All persons in Medicare managed care programs",
"       </td>",
"       <td>",
"        CMS and NCQA Medical Care Outcomes Survey",
"        <sup>",
"         [2]",
"        </sup>",
"       </td>",
"       <td>",
"        Percentage of Medicare members 65 years of age and older who reported having a urine leakage problem in the past six months and who discussed their urinary leakage problem with their current practitioner.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        All women aged 65 and older",
"       </td>",
"       <td rowspan=\"2\">",
"        CMS PQRI",
"        <sup>",
"         [3]",
"        </sup>",
"       </td>",
"       <td>",
"        Assessed for presence or absence of UI within 12 months.",
"       </td>",
"       <td>",
"        Characterization of UI for all women with a diagnosis of UI; may include frequency, volume, timing, type of symptoms, how bothersome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Documented plan of care for all women with a diagnosis of UI; plan may include behavioral interventions, addressing comorbid factors, referral to a specialist, surgery, modifcation or discontinuation of medications, or pharmacologic therapy for incontinence.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nursing Home Residents",
"       </td>",
"       <td>",
"        CMS",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"       <td>",
"        Percent of previously continent low risk residents who develop UI.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Persons receiving Medicare home care services",
"       </td>",
"       <td>",
"        CMS",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Patients who were previously urine incontinent and are now continent.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      1. ACOVE - Assessing Care of Vulnerable Elders, RAND Corporation, file://www.acove.com.",
"      <br>",
"       2. CMS and NCQA - Centers for Medicare and Medicaid Services and National Center for Quality Improvement, Medical Care Outcomes Survey, file://www.hosonline.org/default.aspx; also National Committee for Quality Assurance (NCQA). HEDIS 2006. Health plan employer data &amp; information set. Vol. 2, Technical specifications. Washington (DC): National Committee for Quality Assurance (NCQA); 2005.",
"       <br>",
"        3. CMS PQRI - Centers for Medicare and Medicaid Services Physician Quality Improvement Initiative; file://www.cms.hhs.gov/pqri/.",
"        <br>",
"         4. CMS - Centers for Medicare and Medicaid Services Nursing Home Compare, file://www.medicare.gov/NHCompare/static/Related/AboutMeasures.asp?dest=NAV|Home|About|QualityMeasures#TabTop.",
"         <br>",
"          5. Centers for Medicare and Medicaid Services Home Health Care Compare, file://www.medicare.gov/HHCompare/Home.asp?version=default&amp;browser=IE%7C6%7CWinXP&amp;language=English&amp;defaultstatus= 0&amp;pagelist=Home&amp;CookiesEnabledStatus=True.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
